abstract: |
  Régions de métropole structurées en un document YData avec une géométrie simplifiée provenant de france-geojson
$schema: http://ydclasses.georef.eu/YData/schema
tables:
  regions:
    title: régions indexées sur leur code ISO sans FR- 
    dataSchema:
      $schema: http://json-schema.org/draft-07/schema#
      type: object
      patternProperties:
        ^[A-Z][A-Z][A-Z]$:
          type: object
          required: [name, cinsee, geometry]
          properties:
            name: { description: nom de la région, type: string }
            cinsee: { description: code INSEE, type: integer }
            geometry:
              oneOf:
                - description: GeoJSON Polygon
                  type: object
                  properties:
                    type:
                      const: Polygon
                    coordinates:
                      type: array
                      items:
                        type: array
                        items:
                          type: array
                          minItems: 2
                          maxItems: 2
                          items:
                            type: number
                - description: GeoJSON MultiPolygon
                  type: object
                  properties:
                    type:
                      const: MultiPolygon
                    coordinates:
                      type: array
                      items:
                        type: array
                        items:
                          type: array
                          items:
                            type: array
                            minItems: 2
                            maxItems: 2
                            items:
                              type: number
